import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import '../App.css';

const Componente = () => {
    return (
        <div className='App-header'>
            <h1>Caíste, no me podés pedir nada. Todavía no funciono =)</h1>
        </div>
    )
}

export const Pedido = () => {
    return (
        <div>
            <Componente />
        </div>
    )
}
